import { createTheme } from '@material-ui/core/styles';

const theme = createTheme({
  overrides: {
    MuiDialog: {
      paper: {
        borderRadius: '0px',
        borderTopRightRadius: '0px'
      }
    },
    palette: {
      primary: {
        main: '#000',
      },
      secondary: {
        main: '#000',
      },

    },
  }
});




export default theme;
